using System.Collections;
using System.Collections.Generic;
using System;
using UnityEngine;

public class Relativity : MonoBehaviour
{
    public double ObserverTime;
    public double InitialProperTime;
    public Vector3d InitialVelocity;
    public List<Vector4> Accelerations;

    void Update()
    {
        var currBoost = boost(-InitialVelocity);
        var objOffset = new Vector4d(InitialProperTime, new Vector3d(transform.position)) + currBoost.inverse * new Vector4d { t = -ObserverTime };
        var currPos_Obs = currBoost * objOffset;
        var pastDir = currBoost * new Vector4d { t = -1 };
        Debug.DrawRay(currPos_Obs.draw, pastDir.draw * 1000);
        Debug.DrawRay(Vector3.zero, new Vector3(1, 0, 1) * 1000);
        Debug.DrawRay(Vector3.zero, new Vector3(-1, 0, 1) * 1000);
        Debug.DrawRay(Vector3.zero, new Vector3(-1, 0, -1) * 1000);
        Debug.DrawRay(Vector3.zero, new Vector3(1, 0, -1) * 1000);

        {
            var T = objOffset.time;
            var X = objOffset.space;
            var t = -T - X.magnitude;
            var P = new Vector4d(T + t, X);
            P = currBoost * P;
            if (t <= 0 && P.time <= 0)
            {

                Debug.DrawRay(P.draw, Vector3.up, Color.cyan);
                Debug.DrawRay(P.space.Vector3(), Vector3.up, Color.red);
            }
        }

        Vector3d offset = new Vector3d(transform.parent.position - transform.position);

        for (int i = 0; i < Accelerations.Count; i++)
        {
            var accel = new Vector4d(Accelerations[i]);
            var properDuration = accel.time;
            var a = accel.space;
            properDuration *= 1.0 - a * offset;
            a /= 1.0 - a * offset;
            var MCRFDuration = a.magnitude > Mathf.Epsilon
                ? Math.Sinh(properDuration * a.magnitude) / a.magnitude
                : properDuration;

            var T = objOffset.time;
            var X = objOffset.space;
            var Xa = X * a;
            Debug.Log("T: " + T + " X: " + X.x + "a: " + a.x);
            foreach (double t in intersect(a, T, X))
            {
                if (0 <= t && t < MCRFDuration)
                {
                    var displacement = a.magnitude > Mathf.Epsilon
                        ? a * (Math.Sqrt(1 + t * t * a.sqrMagnitude) - 1) / a.sqrMagnitude
                        : Vector3d.zero;
                    var P = new Vector4d(T + t, X + displacement);
                    P = currBoost * P;
                    if (P.time <= 0)
                    {
                        Debug.DrawRay(P.draw, Vector3.up, Color.cyan);
                        Debug.DrawRay(P.space.Vector3(), Vector3.up, Color.red);
                        break;
                    }
                }
            }

            Vector3d MCRFDisplacement;
            Vector4d newPos_Obs;
            var n = (int)properDuration * 5;
            var properTime = 0.0;
            for (int j = 0; j < n; j++)
            {
                properTime += properDuration / n;
                var t = a.magnitude > Mathf.Epsilon
                    ? Math.Sinh(properTime * a.magnitude) / a.magnitude
                    : properTime;
                MCRFDisplacement = a.magnitude > Mathf.Epsilon
                    ? a * (Math.Sqrt(1 + t * t * a.sqrMagnitude) - 1) / a.sqrMagnitude
                    : Vector3d.zero;
                newPos_Obs = currBoost * (objOffset + new Vector4d(t, MCRFDisplacement));
                Debug.DrawLine(currPos_Obs.draw, newPos_Obs.draw, a.magnitude <= Mathf.Epsilon ? Color.white : i % 2 == 0 ? Color.red : Color.black);
                currPos_Obs = newPos_Obs;
            }
            MCRFDisplacement = a.magnitude > Mathf.Epsilon
                ? a * (Math.Sqrt(1 + MCRFDuration * MCRFDuration * a.sqrMagnitude) - 1) / a.sqrMagnitude
                : Vector3d.zero;
            objOffset += new Vector4d(MCRFDuration, MCRFDisplacement);
            currPos_Obs = currBoost * objOffset;
            var addedVel = a * MCRFDuration / (float)Math.Sqrt(1 + MCRFDuration * MCRFDuration * a.sqrMagnitude);
            currBoost = currBoost * boost(-addedVel);
            objOffset = currBoost.inverse * currPos_Obs;

        }

        var futureDir = currBoost * new Vector4d { t = 1 };
        Debug.DrawRay(currPos_Obs.draw, futureDir.draw * 1000);

        {
            var T = objOffset.time;
            var X = objOffset.space;
            var t = -T - X.magnitude;
            var P = new Vector4d(T + t, X);
            P = currBoost * P;
            if (t > 0 && P.time <= 0)
            {

                Debug.DrawRay(P.draw, Vector3.up, Color.cyan);
                Debug.DrawRay(P.space.Vector3(), Vector3.up, Color.red);
            }
        }
    }

    bool intersectLightCone(Vector3d a, double t, Vector4d objOffset, Matrix4d currBoost, out Vector4d intersection)
    {
        var d = a.magnitude > Mathf.Epsilon
            ? a * (Math.Sqrt(1.0 + t * t * a.sqrMagnitude) - 1f) / a.sqrMagnitude
            : Vector3d.zero;
        var objEvent = objOffset + new Vector4d(t, d);
        intersection = currBoost * objEvent;
        return intersection.time <= 0;
    }

    Matrix4d boost(Vector3d velocity)
    {
        if (velocity.magnitude == 0) return Matrix4d.identity;
        var gamma = (1.0 / Math.Sqrt(1.0 - velocity.sqrMagnitude));
        return new Matrix4d(
            new Vector4d(gamma, -gamma * velocity.x, -gamma * velocity.y, -gamma * velocity.z),
            new Vector4d(-gamma * velocity.x, 1f + (gamma - 1) * velocity.x * velocity.x / velocity.sqrMagnitude, (gamma - 1) * velocity.x * velocity.y / velocity.sqrMagnitude, (gamma - 1) * velocity.x * velocity.z / velocity.sqrMagnitude),
            new Vector4d(-gamma * velocity.y, (gamma - 1) * velocity.y * velocity.x / velocity.sqrMagnitude, 1f + (gamma - 1) * velocity.y * velocity.y / velocity.sqrMagnitude, (gamma - 1) * velocity.y * velocity.z / velocity.sqrMagnitude),
            new Vector4d(-gamma * velocity.z, (gamma - 1) * velocity.z * velocity.x / velocity.sqrMagnitude, (gamma - 1) * velocity.z * velocity.y / velocity.sqrMagnitude, 1f + (gamma - 1) * velocity.z * velocity.z / velocity.sqrMagnitude)
        );
    }

