[Serializable]
public class Vector3d
{
    public double x, y, z;

    public double magnitude {
        get { return Math.Sqrt(x * x + y * y + z * z); }
    }
    public double sqrMagnitude {
        get { return x * x + y * y + z * z; }
    }
    public Vector3d normalized {
        get { return new Vector3d(this) / magnitude; }
    }
    public double this[int index] {
        get {
            switch (index)
            {
                case 0: return x;
                case 1: return y;
                case 2: return z;
                default: throw new ArgumentOutOfRangeException();
            }
        }
        set {
            switch (index)
            {
                case 0: x = value; break;
                case 1: y = value; break;
                case 2: z = value; break;
                default: throw new ArgumentOutOfRangeException();
            }
        }
    }

    public Vector3d()
    {
        x = y = z = 0;
    }
    public Vector3d(double x_, double y_, double z_)
    {
        x = x_;
        y = y_;
        z = z_;
    }
    public Vector3d(Vector3d other)
    {
        x = other.x;
        y = other.y;
        z = other.z;
    }
    public Vector3d(Vector3 other)
    {
        x = other.x;
        y = other.y;
        z = other.z;
    }
    public Vector3 Vector3()
    {
        return new Vector3((float)x, (float)y, (float)z);
    }
    public static Vector3d zero {
        get { return new Vector3d(); }
    }
    public static double operator *(Vector3d lhs, Vector3d rhs)
    {
        return
            lhs.x * rhs.x +
            lhs.y * rhs.y +
            lhs.z * lhs.z;
    }
    public static Vector3d operator +(Vector3d lhs, Vector3d rhs)
    {
        return new Vector3d
        {
            x = lhs.x + rhs.x,
            y = lhs.y + rhs.y,
            z = lhs.z + rhs.z
        };
    }
    public static Vector3d operator *(double d, Vector3d v)
    {
        return new Vector3d
        {
            x = d * v.x,
            y = d * v.y,
            z = d * v.z
        };
    }
    public static Vector3d operator *(Vector3d v, double d)
    {
        return d * v;
    }
    public static Vector3d operator /(Vector3d v, double d)
    {
        if (d == 0) throw new DivideByZeroException();
        return new Vector3d
        {
            x = v.x / d,
            y = v.y / d,
            z = v.z / d
        };
    }
    public static Vector3d operator -(Vector3d v)
    {
        return new Vector3d
        {
            x = -v.x,
            y = -v.y,
            z = -v.z
        };
    }
}

[Serializable]
public class Vector4d
{
    public double t, x, y, z;

    public double magnitude {
        get { return Math.Sqrt(t * t + x * x + y * y + z * z); }
    }
    public double sqrMagnitude {
        get { return t * t + x * x + y * y + z * z; }
    }
    public Vector4d normalized {
        get { return new Vector4d(this) / magnitude; }
    }
    public Vector3d space {
        get { return new Vector3d(x, y, z); }
        set {
            x = value.x;
            y = value.y;
            z = value.z;
        }
    }
    public double time {
        get { return t; }
        set { t = value; }
    }
    public double this[int index] {
        get {
            switch (index)
            {
                case 0: return t;
                case 1: return x;
                case 2: return y;
                case 3: return z;
                default: throw new ArgumentOutOfRangeException();
            }
        }
        set {
            switch (index)
            {
                case 0: t = value; break;
                case 1: x = value; break;
                case 2: y = value; break;
                case 3: z = value; break;
                default: throw new ArgumentOutOfRangeException();
            }
        }
    }


    public Vector4d()
    {
        t = x = y = z = 0;
    }
    public Vector4d(double t, double x, double y, double z)
    {
        this.t = t;
        this.x = x;
        this.y = y;
        this.z = z;
    }
    public Vector4d(Vector4d other)
    {
        t = other.t;
        x = other.x;
        y = other.y;
        z = other.z;
    }
    public Vector4d(Vector4 other)
    {
        //Place the V4d's t coordinate in the x-position of Vector4 so matrix multiplication works correctly.
        //The spatial components then fill out the (y,z,w) positions respectively
        t = other.x;
        x = other.y;
        y = other.z;
        z = other.w;
    }
    public Vector4d(double t, Vector3d s)
    {
        this.t = t;
        x = s.x;
        y = s.y;
        z = s.z;
    }
    public Vector4 Vector4 {
        get {
            return new Vector4((float)t, (float)x, (float)y, (float)z);
        }
    }
    public Vector3 draw {
        get {
            return new Vector3((float)x, (float)y, (float)(z + t));
        }
    }
    public static double operator *(Vector4d lhs, Vector4d rhs)
    {
        return
            lhs.t * rhs.t +
            lhs.x * rhs.x +
            lhs.y * rhs.y +
            lhs.z * lhs.z;
    }
    public static Vector4d operator +(Vector4d lhs, Vector4d rhs)
    {
        return new Vector4d
        {
            t = lhs.t + rhs.t,
            x = lhs.x + rhs.x,
            y = lhs.y + rhs.y,
            z = lhs.z + rhs.z
        };
    }
    public static Vector4d operator *(double d, Vector4d v)
    {
        return new Vector4d
        {
            t = d * v.t,
            x = d * v.x,
            y = d * v.y,
            z = d * v.z
        };
    }
    public static Vector4d operator *(Vector4d v, double d)
    {
        return d * v;
    }
    public static Vector4d operator /(Vector4d v, double d)
    {
        if (d == 0.0) throw new DivideByZeroException();
        return new Vector4d
        {
            t = v.t / d,
            x = v.x / d,
            y = v.y / d,
            z = v.z / d
        };
    }
    public static Vector4d operator -(Vector4d v)
    {
        return new Vector4d
        {
            t = -v.t,
            x = -v.x,
            y = -v.y,
            z = -v.z
        };
    }
}

