            result[6] = -this[0] * this[6] * this[15] +
                this[0] * this[7] * this[14] +
                this[4] * this[2] * this[15] -
                this[4] * this[3] * this[14] -
                this[12] * this[2] * this[7] +
                this[12] * this[3] * this[6];

            result[10] = this[0] * this[5] * this[15] -
                this[0] * this[7] * this[13] -
